DESCRIPTION:
Informuojame, kad buitinių antrinių žaliavų (popieriaus, plastiko, stiklo) jau visą mėnesį nebuvo išimta iš mano namų, adresu Nugaletoju 7E. Konteineris yra perpildytas. UAB „VSA“, kuri tai padarė visus tuos metus, pagaliau atsakė į mano daugybę laiškų. Jie sakė:&#34;
Informuojame, kad nuo 2021-01-01 Bendrovės nebeteikia pakuočių atliekų surinkimo ir išvežimo paslaugų ... Malonių prašymai kreiptis į Vilniaus miesto savivaldybės administraciją dėl informacijos suteikimo. &#34;
Kas ir kada bus atsakingas už šiukšlių išvežimą? Kada bus masina sausio metu?
prašau skubiai atsakyti
